import React from 'react';
class Header extends React.Component
{
  render() {
    return (
      <div class="hroot">
          <div class="hleft">Welcome to Dummy!</div>
          <div class="hright">Welcome to Dummy!</div>
      </div>
    );
  }
}
export default Header;
